import { applyMiddleware, configureStore, getDefaultMiddleware } from "@reduxjs/toolkit";
import expresstionReducer from "../reducer";
import thunk from "redux-thunk";
export const store = configureStore({
    reducer: {
        expresstion: expresstionReducer,
        middleware: [applyMiddleware(thunk), getDefaultMiddleware()]
    }
});

export default store;
